import React from "react";
import "./Toolbar.css";
import Logo from "../../Logo/Logo";
import NavigationItems from "../NavigationItems/NavigationItems";
const toolbar = (props) => {
  return (
    <div className="Toolbar">
      <Logo />
      <nav>
        <NavigationItems />
      </nav>
      <div>
        <div>Liên Kết Ví</div>
        <div>Hướng dẫn</div>
      </div>
    </div>
  );
};
export default toolbar;
